import React from "react";
import ReactDom from "react-dom";
import myNumber from "./App";

ReactDom.render (
  <>
    <ol>
      <li> Sum of two no is {add  (10,20)} </li>
      <li> sub of two no is {myNumber()}  </li>
      <li> mul of two no is {myNumber()} </li>
      <li> div of two no is {myNumber()} </li>
    </ol>
  </>,
  document.getElementById("root")

);
